import React from "react";
import "./card.css";

const expandCard = e => {
  if (!e.target.classList.contains("show")) {
    e.target.classList.add("show");
  } else {
    e.target.classList.remove("show");
  }
};
const ListCard = () => {
  return (
    <div className="card">
      <div className="card-top">
        <h3>name</h3>
        <h3>continent</h3>
      </div>
      <button onClick={expandCard} className="expand-card-btn">
        Expand
      </button>
      <div className="card-extra">
        <h3>name</h3>
        <h3>continent</h3>
      </div>
    </div>
  );
};
export default ListCard;
